Supernatural is een Amerikaanse serie van de zender The WB. 

Supernatural gaat over de broers Winchester die het bovennatuurlijke kwaad bestrijden. Ze nemen hierbij de taak van hun vader John over, 
die hiermee begonnen is om de dood van zijn vrouw te wreken. Dankzij hun vader groeien Sam en Dean op als demonenjagers. 
In elke aflevering lossen Dean en Sam een mysterie op door met een bovennatuurlijke tegenstander af te rekenen.

